import React from 'react';
import { useNavigate } from 'react-router-dom';

function WeekselectionPage() {
  const navigate = useNavigate();

  const handleWeekSelect = () => {
    navigate('/attendance');
  };

  return (
    <div>
      <h1>Week Selection</h1>
      <button onClick={handleWeekSelect}>Continue to Attendance</button>
    </div>
  );
}

export default WeekselectionPage;
